import React from "react";

function HomeFooter() {
  return (
    <div className="home-footer-wrapper">
      <div class="triangle-col">
        <div class="triangle-background"></div>
      </div>
      <div className="home-footer">Artwork created by Kaylie Bywater <a href="" >@sunshine.doodler</a></div>
    </div>
  );
}

export default HomeFooter;
